import React from 'react'
import {Box,User,Form} from './Hero.Elements'; 
import TextField from '@material-ui/core/TextField';
import { AiOutlineUser } from "react-icons/ai";




function Hero() {
    return (
        <>
          <Box>
                <User>
                User Login
                </User>
                <Form>
                <AiOutlineUser />
                <TextField
        className={classes.margin}
        id="input-with-icon-textfield"
        label="TextField"
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
      />
             
                </Form>
           </Box>
        </>
    )
}
export default Hero;
